import React from 'react';
import group from '../photos/group.jpg'
import styled from 'styled-components'
import { FaHeart } from "react-icons/fa";


const Div = styled.div`
margin-top: 100px;
width:100vw;
height:100vh;
background: url(${group});
background-position:center;
background-repeat:no-repeat;
background-size:cover;
background-attachment: fixed;
`

const H1 = styled.h1`
color:#404040;
text-align:center;
background:white;
`


function Advantages() {
    return (
        <Div >
            <H1>Genom oss har 42 000 människor hittat sin perfekta partner.
                Försök, det är gratis att gå med.</H1>
            <div>
                <div>
                    <FaHeart />
                    <h2>naslov</h2>
                    <h3>malo vise ovo ono asdasd asdkasd </h3>
                </div>
            </div>
        </Div>
    );
}

export default Advantages;
